INSERT INTO `v1_cd5e981c22a0f5542353157284755c5f57ff85d1ba67433bfa20f1a7ab97b5af` VALUES (24, "2030/12/17 14:59:59", 24001, 2, 10046, 401, "2020/07/31 12:00:00", 0.0, 0.0, 0.0, 2, "アヤネ", "やったね、ぷうきち！\nこれならお兄ちゃんたちの\nお手本になれたよね！", 102301);
INSERT INTO `v1_cd5e981c22a0f5542353157284755c5f57ff85d1ba67433bfa20f1a7ab97b5af` VALUES (24, "2030/12/17 14:59:59", 24002, 1, 10046, 402, "2020/07/31 12:00:00", 0.0, 2.21, 0.0, 2, "アヤネ", "私たちの勝ちだね！\nぷうきちと一緒なら\nどんなボールでも\nホームランを打ってみせるよ！", 102301);
INSERT INTO `v1_cd5e981c22a0f5542353157284755c5f57ff85d1ba67433bfa20f1a7ab97b5af` VALUES (24, "2030/12/17 14:59:59", 24003, 2, 10046, 403, "2020/07/31 12:00:00", 0.0, 0.0, 0.0, 2, "アヤネ", "やったやったぁ！\nお兄ちゃん、見ててくれた？\n私、すっごくがんばったよ！", 102301);
INSERT INTO `v1_cd5e981c22a0f5542353157284755c5f57ff85d1ba67433bfa20f1a7ab97b5af` VALUES (24, "2030/12/17 14:59:59", 24004, 2, 10046, 701, "2020/07/31 12:00:00", 0.0, 1.99, 0.0, 1, "アサヒ", "特訓の成果が出たみたいだ！\nもっと練習を重ねて\nこの調子で上達していこう！", 192201);
INSERT INTO `v1_cd5e981c22a0f5542353157284755c5f57ff85d1ba67433bfa20f1a7ab97b5af` VALUES (24, "2030/12/17 14:59:59", 24005, 1, 10046, 702, "2020/07/31 12:00:00", 0.0, 2.21, 0.0, 2, "アサヒ", "よし、いい感じだ！\nキャプテンとしての仕事は\nきっちり果たせそうだよ", 192201);
INSERT INTO `v1_cd5e981c22a0f5542353157284755c5f57ff85d1ba67433bfa20f1a7ab97b5af` VALUES (24, "2030/12/17 14:59:59", 24006, 2, 10046, 703, "2020/07/31 12:00:00", 0.0, 3.33, 0.0, 1, "アサヒ", "試合に向けて\nいい感覚を掴めた気がするよ！\nこのまま一気に全国大会だ！", 192201);
INSERT INTO `v1_cd5e981c22a0f5542353157284755c5f57ff85d1ba67433bfa20f1a7ab97b5af` VALUES (24, "2030/12/17 14:59:59", 24007, 2, 10046, 801, "2020/07/31 12:00:00", 0.0, 0.0, 0.0, 2, "部員３", "このくらい余裕だ\nオレたちは全国大会を\n目指してるんだからな", 192301);
INSERT INTO `v1_cd5e981c22a0f5542353157284755c5f57ff85d1ba67433bfa20f1a7ab97b5af` VALUES (24, "2030/12/17 14:59:59", 24008, 1, 10046, 802, "2020/07/31 12:00:00", 0.0, 2.68, 0.0, 2, "部員３", "オレだって\nビーチベースボール選手だ\nどんな球だろうが\n全部スタンドまで飛ばしてやる", 192301);
INSERT INTO `v1_cd5e981c22a0f5542353157284755c5f57ff85d1ba67433bfa20f1a7ab97b5af` VALUES (24, "2030/12/17 14:59:59", 24009, 2, 10046, 803, "2020/07/31 12:00:00", 0.0, 0.0, 0.0, 2, "部員３", "いい感じだ\nこれなら試合でも活躍できそうだ\n大暴れしてやる！", 192301);
INSERT INTO `v1_cd5e981c22a0f5542353157284755c5f57ff85d1ba67433bfa20f1a7ab97b5af` VALUES (24, "2030/12/17 14:59:59", 24010, 1, 10046, 501, "2020/07/31 12:00:00", 0.0, 0.0, 0.0, 1, "", "やった！", 192501);
INSERT INTO `v1_cd5e981c22a0f5542353157284755c5f57ff85d1ba67433bfa20f1a7ab97b5af` VALUES (24, "2030/12/17 14:59:59", 24011, 1, 10046, 502, "2020/07/31 12:00:00", 0.0, 0.0, 0.0, 1, "", "勝ったよ！", 192501);
INSERT INTO `v1_cd5e981c22a0f5542353157284755c5f57ff85d1ba67433bfa20f1a7ab97b5af` VALUES (24, "2030/12/17 14:59:59", 24012, 1, 10046, 503, "2020/07/31 12:00:00", 0.0, 0.0, 0.0, 1, "", "いい調子！", 192501);
INSERT INTO `v1_cd5e981c22a0f5542353157284755c5f57ff85d1ba67433bfa20f1a7ab97b5af` VALUES (24, "2030/12/17 14:59:59", 24013, 6, 10046, 111, "2020/07/31 12:00:00", 0.0, 5.33, 0.0, 2, "ミサト", "あら～…もしかして\n勝っちゃったのかしら？\nみんなの練習を見ていたから\nかもしれないわね", 113501);
INSERT INTO `v1_cd5e981c22a0f5542353157284755c5f57ff85d1ba67433bfa20f1a7ab97b5af` VALUES (24, "2030/12/17 14:59:59", 24014, 1, 10046, 112, "2020/07/31 12:00:00", 0.0, 6.85, 0.0, 2, "ミサト", "みんなの力になりたくて\n先生も頑張ってみました～！\nうまく投げられたみたいで\nよかったわ～！", 113501);
INSERT INTO `v1_cd5e981c22a0f5542353157284755c5f57ff85d1ba67433bfa20f1a7ab97b5af` VALUES (24, "2030/12/17 14:59:59", 24015, 1, 10046, 113, "2020/07/31 12:00:00", 0.0, 3.0, 0.0, 2, "ミサト", "練習お疲れさま～！\n先生も協力できて\nとってもうれしいわ～♪\n次も頑張りましょうね～！", 113501);
INSERT INTO `v1_cd5e981c22a0f5542353157284755c5f57ff85d1ba67433bfa20f1a7ab97b5af` VALUES (24, "2030/12/17 14:59:59", 24016, 1, 10046, 611, "2020/07/31 12:00:00", 0.0, 6.11, 0.0, 2, "ダイチ", "まだ練習が足りねえみてえだな\nこれっぽっちも本気で\n投げてねえっつーの\nもう一回やんぞ！", 192401);
INSERT INTO `v1_cd5e981c22a0f5542353157284755c5f57ff85d1ba67433bfa20f1a7ab97b5af` VALUES (24, "2030/12/17 14:59:59", 24017, 1, 10046, 612, "2020/07/31 12:00:00", 0.0, 6.75, 0.0, 2, "ダイチ", "ふん、当然の結果だな\n俺の球は、誰にも打てねえよ！\nまたやりてえっつーなら\nとことん付き合ってやるぜ！", 192401);
INSERT INTO `v1_cd5e981c22a0f5542353157284755c5f57ff85d1ba67433bfa20f1a7ab97b5af` VALUES (24, "2030/12/17 14:59:59", 24018, 2, 10046, 613, "2020/07/31 12:00:00", 0.0, 0.0, 0.0, 2, "ダイチ", "おっしゃあ！\nこの勢いで全国に行ってやるぜ！\n全員三振で仕留めてやる！", 192401);
INSERT INTO `v1_cd5e981c22a0f5542353157284755c5f57ff85d1ba67433bfa20f1a7ab97b5af` VALUES (24, "2030/12/17 14:59:59", 24019, 2, 10046, 211, "2020/07/31 12:00:00", 0.0, 4.52, 0.0, 1, "ハツネ", "きらーん☆\nハツネちゃんの大勝利なのだ～！\nみんながもっと上達できるように\n私もまだまだ頑張るからね！", 113401);
INSERT INTO `v1_cd5e981c22a0f5542353157284755c5f57ff85d1ba67433bfa20f1a7ab97b5af` VALUES (24, "2030/12/17 14:59:59", 24020, 2, 10046, 212, "2020/07/31 12:00:00", 0.0, 3.89, 0.0, 1, "ハツネ", "やったあ！　私の勝ちだね！\nチアリーダーもピッチャーも\nハツネちゃんに任せてよ！", 113401);
INSERT INTO `v1_cd5e981c22a0f5542353157284755c5f57ff85d1ba67433bfa20f1a7ab97b5af` VALUES (24, "2030/12/17 14:59:59", 24021, 1, 10046, 213, "2020/07/31 12:00:00", 0.0, 13.49, 0.0, 2, "ハツネ", "よお～し、この調子でもっと\n頑張ろう…と思ったけど\n超能力を使ったから…\n眠くなってきちゃった…すやぁ…", 113401);
INSERT INTO `v1_cd5e981c22a0f5542353157284755c5f57ff85d1ba67433bfa20f1a7ab97b5af` VALUES (24, "2030/12/17 14:59:59", 24022, 1, 10046, 311, "2020/07/31 12:00:00", 0.0, 3.17, 0.0, 2, "カヤ", "いい勝負だったぜ！\nたぎっちまって\nつい本気で投げちまったよ", 106501);
INSERT INTO `v1_cd5e981c22a0f5542353157284755c5f57ff85d1ba67433bfa20f1a7ab97b5af` VALUES (24, "2030/12/17 14:59:59", 24023, 1, 10046, 312, "2020/07/31 12:00:00", 0.0, 4.42, 0.0, 2, "カヤ", "どうだ？\nオレ様のボールは熱かっただろ！\nま、でもおまえらの根性も\nなかなかのもんだったぜ", 106501);
INSERT INTO `v1_cd5e981c22a0f5542353157284755c5f57ff85d1ba67433bfa20f1a7ab97b5af` VALUES (24, "2030/12/17 14:59:59", 24024, 6, 10046, 313, "2020/07/31 12:00:00", 0.0, 2.89, 0.0, 1, "カヤ", "なんだよ、そんなもんか？\nこっちはまだまだ投げたりねえ\nもっと勝負しようぜ！", 106501);
INSERT INTO `v1_cd5e981c22a0f5542353157284755c5f57ff85d1ba67433bfa20f1a7ab97b5af` VALUES (24, "2030/12/17 14:59:59", 24025, 4, 10046, 421, "2020/07/31 12:00:00", 0.0, 3.71, 0.0, 3, "アヤネ", "あとちょっとだったのに～！\n次こそぷうきちと一緒に\n勝ってみせるからね！", 102301);
INSERT INTO `v1_cd5e981c22a0f5542353157284755c5f57ff85d1ba67433bfa20f1a7ab97b5af` VALUES (24, "2030/12/17 14:59:59", 24026, 2, 10046, 721, "2020/07/31 12:00:00", 0.0, 5.1, 0.0, 1, "アサヒ", "いい勝負だったね！\nでも、やっぱり悔しいな…\nもっと練習して\n今度は絶対に俺が勝つから！", 192201);
INSERT INTO `v1_cd5e981c22a0f5542353157284755c5f57ff85d1ba67433bfa20f1a7ab97b5af` VALUES (24, "2030/12/17 14:59:59", 24027, 1, 10046, 821, "2020/07/31 12:00:00", 0.0, 4.34, 0.0, 3, "部員３", "ちっ…あと一歩足りなかったか\n次こそは絶対に勝つから\nそのつもりでいろ", 192301);
INSERT INTO `v1_cd5e981c22a0f5542353157284755c5f57ff85d1ba67433bfa20f1a7ab97b5af` VALUES (24, "2030/12/17 14:59:59", 24028, 1, 10046, 521, "2020/07/31 12:00:00", 0.0, 0.0, 0.0, 1, "", "いい勝負だったよ\nまたやろうね", 192501);
INSERT INTO `v1_cd5e981c22a0f5542353157284755c5f57ff85d1ba67433bfa20f1a7ab97b5af` VALUES (24, "2030/12/17 14:59:59", 24029, 1, 10046, 101, "2020/07/31 12:00:00", 0.0, 5.62, -360.0, 2, "ミサト", "とってもよくできました～♪\n頑張ってくれて先生うれしいわ\nこれからも試合に向けて\n練習していきましょうね～", 113501);
INSERT INTO `v1_cd5e981c22a0f5542353157284755c5f57ff85d1ba67433bfa20f1a7ab97b5af` VALUES (24, "2030/12/17 14:59:59", 24030, 1, 10046, 102, "2020/07/31 12:00:00", 0.0, 9.58, -360.0, 2, "ミサト", "頑張った成果ね～！\nこのまま練習を続ければ\nもっとすごい成績を残せそうよ\n期待してますからね～！", 113501);
INSERT INTO `v1_cd5e981c22a0f5542353157284755c5f57ff85d1ba67433bfa20f1a7ab97b5af` VALUES (24, "2030/12/17 14:59:59", 24031, 2, 10046, 103, "2020/07/31 12:00:00", 0.0, 0.0, -360.0, 2, "ミサト", "いい子、いい子～♪\n頑張り屋さんのあなたを\nたっくさん褒めてあげますからね", 113501);
INSERT INTO `v1_cd5e981c22a0f5542353157284755c5f57ff85d1ba67433bfa20f1a7ab97b5af` VALUES (24, "2030/12/17 14:59:59", 24032, 2, 10046, 104, "2020/07/31 12:00:00", 0.0, 9.13, -360.0, 1, "ミサト", "夢に向けて、一歩前進できたわね\nこの調子で、夢を叶えましょう\n目指せ、全国大会～！", 113501);
INSERT INTO `v1_cd5e981c22a0f5542353157284755c5f57ff85d1ba67433bfa20f1a7ab97b5af` VALUES (24, "2030/12/17 14:59:59", 24033, 1, 10046, 105, "2020/07/31 12:00:00", 0.0, 8.27, -360.0, 2, "ミサト", "絶好調ね～♪\nきっと試合でも大活躍\n間違いなしだわ\n楽しみにしていますからね～！", 113501);
